script: |
  super -f text -I q3289.spq | sort > q3289.out

inputs:
  - name: q3289.spq
    data: |
      SELECT ALL 53 - + + col0 + col2 * + 56 - ( col2 ) + + + col1 - + col0 AS col0, + col1 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT + - col0 <= ( + col1 );
  - name: tab2

outputs:
  - name: q3289.out
    data: |
